  const titleInputHandler = (id, value, isValid) => {};

  return (
    <form className="place-form">
      <Input
        element="input"
        type="text"
        label="Title"
        validators={[VALIDATOR_REQUIRE()]}
        errorText="Please enter a valid title."
        onInput={titleInputHandler}
      />
    </form>
  );
};

export default NewPlace;
